import React from 'react';
import {Sidebar} from '../components/'

const DashboardPage = () => {
  return (
    <div>
      <div className='container-fluid'>
        <div className='row base'>
          <div className='sidebar col-3'>
            <Sidebar/>
          </div>
        </div>
      </div>
    </div>
  )
}

export default DashboardPage
